import React from 'react';

function Home({ posts }) {
  return (
    <div className="home">
      <h1>Home</h1>
      {posts.map((post, index) => (
        <div key={index}>
          <h3>{post.title}</h3>
          <p>{post.caption}</p>
          <img src={post.imageUrl} alt={`Post ${index}`} />
        </div>
      ))}
    </div>
  );
}

export default Home;
